#!/usr/bin/env python
"""
From the individual g1^n gi^(4-n) terms, calculate g1^m gi^(2-m) terms for production and decay separately
The normalization is arbitrary, set the coefficient of g1^2 gi^0 for decay = 1

Mathematica code:
{x0 == y0 z0, x1 == y1 z0 + y0 z1, x2 == y0 z2 + y2 z0 + y1 z1, x3 == y1 z2 + y2 z1, x4 == y2 z2, z0 == 1}

Solve[%1, {y0, y1, y2, z0, z1, z2}]

#http://mathematica.stackexchange.com/a/85449
SetOptions[$Output, PageWidth -> Infinity];

FortranForm[y0 /. %2]
FortranForm[y1 /. %2]
FortranForm[y2 /. %2]
FortranForm[z0 /. %2]
FortranForm[z1 /. %2]
FortranForm[z2 /. %2]

have to make the following changes:
 - define List and Sqrt as below
 - replace complex numbers with python format (in nano, replace ([(][0-9][^(),]*,[^(),]*[)]) with complex\1)
"""

from __future__ import division
import cmath
from enums import Analysis
import numpy
from samples import ReweightingSample, Sample
from templates import TemplatesFile
from utilities import tfiles

#so that the mathematica FortranForm can be used directly
def List(*args): return list(args)
Sqrt = cmath.sqrt


def get5components(tree, analysis, productionmode, basehypothesis=None):
    templatesfile = TemplatesFile(analysis, str(productionmode.lower()), "Untagged", "2e2mu")
    invertedmatrix = templatesfile.invertedmatrix

    basexsec = 1
    if basehypothesis is not None:
        basexsec = ReweightingSample(productionmode, basehypothesis).xsec

    vectorofweights = []
    for template in templatesfile.templates():
        sample = ReweightingSample(productionmode, template.hypothesis)
        vectorofweights.append([getattr(tree, sample.weightname()) * sample.xsec / basexsec])

    return invertedmatrix * vectorofweights

