def getweightsback(y0, y1, y2, z0, z1, z2):
    return (
            y0*z0,
            y0*z1 + y1*z0,
            y0*z2 + y1*z1 + y2*z0,
                    y1*z2 + y2*z1,
                            y2*z2,
           )

